void example_ili9320(void)
{
	sysclk_init();
	ioport_init();
	board_init();
	
	// Init component
	ili9320_init();

	// Clear all screen with blue color
	ili9320_clear_screen(ILI9320_BLUE);
			
	// Example: display image from internal FLASH memory
	ili9320_set_window(1,1,IMAGE_WIDTH,IMAGE_HEIGHT);
	ili9320_copy_progmem_pixels_to_screen(image, IMAGE_HEIGHT*IMAGE_WIDTH);
	
	delay_s(3);
	
	// Draw pixel by pixel screen with white
	ili9320_set_cursor(0, 0);
	for (int x=0;x<240;x++)
	{
		for(int y=0;y<320;y++)
		{
			ili9320_write_gram(ILI9320_WHITE);
		}
	}
	
	while(true)
	{
		delay_ms(100);
	}
}

